package net.jeeshop.services.manage.keyvalue.bean;import java.io.Serializable;import net.jeeshop.core.dao.page.PagerModel;public class Keyvalue extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String key1;	private String value;	private String explain1;		@Override	public void clear() {		super.clear();		id = null;		key1 = null;		value = null;	}	@Override	public String getId() {		return id;	}	@Override	public void setId(String id) {		this.id = id;	}	public String getKey1() {		return key1;	}	public void setKey1(String key1) {		this.key1 = key1;	}	public String getValue() {		return value;	}	public void setValue(String value) {		this.value = value;	}	public String getExplain1() {		return explain1;	}	public void setExplain1(String explain1) {		this.explain1 = explain1;	}	}